// SPDX-License-Identifier: Proprietary

pragma solidity ^0.8.11;

import "@chainlink/contracts/src/v0.8/AutomationCompatible.sol";
import "./Dhakon.sol";

contract DhakonPickingWinnerCoordinator is AutomationCompatibleInterface
{
    Dhakon dhakon;

    constructor(address _dhakonAddr) 
    {
        dhakon = Dhakon(_dhakonAddr);
    }

    function checkUpkeep(bytes calldata /* checkData */) external view override
        returns (bool upkeepNeeded, bytes memory /* performData */)
    {
        upkeepNeeded = dhakon.roundEndsAt() <= block.timestamp;
    }

    function performUpkeep(bytes calldata /* performData */) external override 
    {
        assert(dhakon.roundEndsAt() <= block.timestamp);

        dhakon.pickWinner();
    }

}
